const SortDropdown = () => {
    return (
        <div className="sort-dropdown">
            <h1>Sort</h1>
            <select name="" id="">
                <option value="">Most Viewers</option>
                <option value="">Least Viewers</option>
            </select>
        </div>
    )
}

export default SortDropdown
